import React from 'react';
import ReactDOM from 'react-dom';

import {
  Route,
  NavLink,
  BrowserRouter
} from "react-router-dom";

import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

import TestComponent from './test_page.js';
import TestComponent2 from './test_page2.js';
import TestComponent3 from './test_page3.js';

import "./css/App.css";

function App() {
  return (
    <div className="App">
      <BrowserRouter basename = "/">
        <Navbar expand="lg" style={{backgroundImage:"linear-gradient(to right, #7d32a8 30%, #cf5f6a)"}} sticky='top'>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="text-24pt" style={{width: "100%"}}>
            <div style={{display: "flex", width: "100%", justifyContent:"space-between"}}>
              <Nav.Link className="my-nav-link" style={{paddingLeft: "2vw", color:"white"}} to="/" href="/">ACP</Nav.Link>
              <div style={{textAlign:"center"}}>
                <Nav.Link className="my-nav-link" style={{paddingRight: "2vw", display:"inline-block", color:"white"}} to="/about" href="/about">About</Nav.Link>
                <Nav.Link className="my-nav-link" style={{paddingRight: "2vw", display:"inline-block", color:"white"}} to="/contact" href="/contact">Contact</Nav.Link>
              </div>
            </div>
          </Nav>
        </Navbar.Collapse>
        </Navbar>

        <Route exact path="/" component={TestComponent} />
        <Route path="/about" component={TestComponent2} />
        <Route path="/contact" component={TestComponent3} />
      </BrowserRouter>
    </div>
  );
}

export default App;
